import React from 'react'
import { Card, Icon, Avatar } from 'antd'

const { Meta } = Card


export default function CharacterCard(

    {
        name,
        image,
        house,
        loading,
    }
) {

    return (
        <Card
            loading={loading}
            hoverable
            style={{ width: 185, marginTop: "10px" }}
            cover={<img alt={name} src={image}/>}
        >
            <Meta title={name} description={house} />
        </Card>
    )
}
